In this guide, we will monitor two HTTP services, that will need to return a 200 OK status code to pass. Each check will run every 10 seconds and will require three failures to be considered failed. We will use the Defcon API to create the checks. Our first check can be represented with the following JSON: { "name": "Successful HTTP request", "interval": "10s", "sites": ["@controller"], "passing_threshold": 3, "failing_threshold": 3, "site_threshold": 1, "spec": { "kind": "http", "url": "http://jsonplaceholder.typicode.com/users", "code": 200 }
} This snippet defines the following: The human-readable name for this check The interval at which the check should be run (here, 10 seconds) The sites on which the check will be run (@controller is the implicit name for Defcon's controller) Each site will be considered as failed when the checks fails three times in a row, and recovered after three successes An outage will be created when the number of failed sites reaches 1 This check uses the http handler, making a GET request to the provided URL, and expect a response status code of 200 You can create the check by performing a POST request to http://127.0.0.1:8000/api/checks: $ curl -v -XPOST http://127.0.0.1:8000/api/checks -d@book.json
HTTP/1.1 201 Created
location: /api/checks/82a3b532-0883-4544-ba2c-0a7159a89d8e You can check the configuration for this check by calling the API with the returned path: $ curl http://127.0.0.1:8000/api/checks/82a3b532-0883-4544-ba2c-0a7159a89d8e
{ "alerter": null, "enabled": true, "failing_threshold": 3, "interval": "10s", "name": "Successful HTTP request", "passing_threshold": 3, "silent": false, "site_threshold": 0, "sites": [ "@controller" ], "spec": { "code": 200, "content": null, "digest": null, "headers": {}, "kind": "http", "timeout": null, "url": "http://jsonplaceholder.typicode.com/users" }, "uuid": "82a3b532-0883-4544-ba2c-0a7159a89d8e"
}
